import './App.css';

import React, { Component } from 'react';
import { render } from 'react-dom';

class Calendar extends Component {
  constructor(props){
    super(props);
    this.state = {};
    this.url = 'http://slack-server-production.us-west-2.elasticbeanstalk.com/calendar/NY/28';
    this.calData = {};
  }

  getData(url){
    //fetch calendar data
    fetch(url)
      .then((data) => data.json())
      .then((data) => this.calData = data)
      // .catch((error) => console.log(error))
      .then(setTimeout(() => console.log(this.calData), 1000))
  }

  componentDidMount(){
    this.getData(this.url);
  }

  render() {
    return (
      <div>
        <h1>Calendar</h1>
      </div>
    );
  }
}

